import React, { useState } from "react";
import { Container, Typography, Card, CardContent, Grid, LinearProgress, Dialog, DialogTitle, DialogContent, DialogActions, Button } from "@mui/material";

// Frontend Skills
const frontendSkills = [
    { title: "JavaScript", level: 90 },
    { title: "React.js", level: 85 },
    { title: "HTML5", level: 90 },
    { title: "CSS3", level: 85 },
    { title: "HTML5", level: 95 },
    { title: "CSS", level: 100 },
    { title: "Figma", level: 90 },
];

// Backend Skills
const backendSkills = [
    { title: "Java", level: 90 },
    { title: "C", level: 75 },
    { title: "Python", level: 65 },
    { title: "TypeScript", level: 70 },
    { title: "R", level: 80 },
    { title: "MySQL", level: 85 },
    { title: "React-Native", level: 85 }, // Note: React-Native can be used for mobile (frontend) or backend
    { title: "FastAPI", level: 60 },
    { title: "JSON", level: 90 },
    { title: "Node.js", level: 90 },
];

// Common Skills (Tools and Practices)
const commonSkills = [
    { title: "Postman", level: 80 },
    { title: "Git", level: 95 },
    { title: "Linux", level: 70 },
];
const calculateAverageLevel = (skills) => {
    const totalLevels = skills.reduce((sum, skill) => sum + skill.level, 0);
    const averageLevel = totalLevels / skills.length;
    return Math.round(averageLevel * 100) / 100; // Round to two decimal places
};

// Render average skill card
const renderAverageSkillCard = (category, averageLevel, onClick) => (
    <Grid item xs={12} sm={6} md={6} key={category}>
        <Card elevation={3} onClick={onClick}>
            <CardContent>
                <Typography variant="h6" color="textSecondary" gutterBottom>
                    {category}
                </Typography>
                <LinearProgress variant="determinate" value={averageLevel} />
                <Typography variant="body2" color="textSecondary">
                    Average Level: {averageLevel}%
                </Typography>
            </CardContent>
        </Card>
    </Grid>
);

// Skill Component
const Skill = () => {
    const [openModal, setOpenModal] = useState(false);
    const [selectedSkill, setSelectedSkill] = useState(null);

    const handleCardClick = (category, averageLevel) => {
        setSelectedSkill({ category, averageLevel });
        setOpenModal(true);
    };

    const handleCloseModal = () => {
        setOpenModal(false);
        setSelectedSkill(null);
    };
    return (
        <Container id="intro" sx={{ display: "flex", flexDirection: "column", alignItems: "center", justifyContent: "center", height: "100%" }}>
            <Typography variant="h2" fontWeight={"bold"} align="center" mb={10}>
                Skills
            </Typography>
            <Grid container spacing={3}>
                {/* Frontend Skills */}
                {renderAverageSkillCard("Frontend Skills", calculateAverageLevel(frontendSkills), () => handleCardClick("Frontend Skills", calculateAverageLevel(frontendSkills)))}

                {/* Backend Skills */}
                {renderAverageSkillCard("Backend Skills", calculateAverageLevel(backendSkills), () => handleCardClick("Backend Skills", calculateAverageLevel(backendSkills)))}

                {/* Common Skills */}
                {renderAverageSkillCard("Common Skills", calculateAverageLevel(commonSkills), () => handleCardClick("Common Skills", calculateAverageLevel(commonSkills)))}
            </Grid>

            <Typography variant="body1" align="center" color="textSecondary" mt={5} paragraph>
                Click cards to see detail about skills
            </Typography>

            {/* Modal */}
            <Dialog open={openModal} onClose={handleCloseModal} maxWidth="md">
                <DialogTitle sx={{ backgroundColor: "#1976D2", color: "#FFF" }}>
                    {selectedSkill && selectedSkill.category}
                </DialogTitle>
                <DialogContent sx={{ backgroundColor: "#E3F2FD" }}>
                    {selectedSkill && (
                        <>
                            <Typography variant="body2" color="textSecondary">
                                Average Level: {selectedSkill.averageLevel}%
                            </Typography>

                            <ul>
                                {selectedSkill.category === "Frontend Skills" && frontendSkills.map(skill => (
                                    <li key={skill.title}>{skill.title}: {skill.level}%</li>
                                ))}
                                {selectedSkill.category === "Backend Skills" && backendSkills.map(skill => (
                                    <li key={skill.title}>{skill.title}: {skill.level}%</li>
                                ))}
                                {selectedSkill.category === "Common Skills" && commonSkills.map(skill => (
                                    <li key={skill.title}>{skill.title}: {skill.level}%</li>
                                ))}
                            </ul>
                        </>
                    )}
                </DialogContent>
                <DialogActions sx={{ backgroundColor: "#E3F2FD" }}>
                    <Button onClick={handleCloseModal} variant="outlined" sx={{ color: "#1976D2" }}>
                        Close
                    </Button>
                </DialogActions>
            </Dialog>
        </Container>
    );
};

export default Skill;
